import Fetch from "./dataFetch"
import { GetRequest } from "./GetRequest"

export const synCode = (saveHistory, result) => {
     Fetch('/', 'POST', saveHistory, result)
    const zeroHistory =  GetRequest.getHistory().then(data => {
        const zeroHistory = data[0]
        return zeroHistory
    })
    return zeroHistory
}
